import React from "react";
import classes from "./AvailableMeal.module.css";

const AvailableMeal = () => {
  return (
    <div className={classes.meal}>
      <ul>
        <li>sushi</li>
        <li>bread</li>
      </ul>
    </div>
  );
};

export default AvailableMeal;
